import './main.css';
import './Base.css';
import './css/fonts/fontawesome-free-6.2.0/css/all.min.css';
import React, { Component } from 'react';
import Login from './login';



class Header extends Component{

    onPressLogin(){
        <Login />
    }

    render() {
        return(
           <button onClick={this.onPressLogin}> 
                click me
            </button> 
        );
    }
}

export default Header;
